import React, { useEffect } from "react";

function GetData() {
  const rightCartData = (e: any) => {
    console.log("改变啦");
    console.log("e111", e);
  };
  useEffect(() => {
    window.addEventListener("storage", (e) => rightCartData);
    return () => {
      window.removeEventListener("storage", rightCartData);
    };
  }, []);

  return <div>获取数据啦</div>;
}

export default GetData;
